(self.webpackChunkblog=self.webpackChunkblog||[]).push([[6198],{56198:n=>{n.exports="### title\n\n实现 pow(x, n) , 即计算 x 的 n 次幂函数。\n\n示例 1:\n\n```\n输入: 2.00000, 10\n输出: 1024.00000\n```\n\n示例 2:\n\n```\n输入: 2.10000, 3\n输出: 9.26100\n```\n\n示例 3:\n\n```\n输入: 2.00000, -2\n输出: 0.25000\n解释: 2-2 = 1/22 = 1/4 = 0.25\n```\n\n说明:\n\n* -100.0 < x < 100.0\n* n 是 32 位有符号整数, 其数值范围是 [−231, 231 − 1]\n\n### analyze\n\n```js\n/**\n * @param {number} x\n * @param {number} n\n * @return {number}\n */\nvar myPow = function (x, n) {\n  return Math.pow(x, n)\n}\n```"}}]);